import React from "react";
import Card from "./card.jsx";

const ListCards = ({ robots }) => {
  const robotsComponent = robots.map((robot, i) => {
    return (
      <Card id={robot[i].id} name={robot[i].name} email={robot[i].email} />
    );
  });

  return (
  <div>
      {robotsComponent}
      </div>
      );
};

export default ListCards;
